import logo from "./logo.svg";
import "./App.css";
import { Slider } from "./launchPage";
import { Container, Row, Col } from "react-bootstrap";
function App() {
  return (
    <div className="App">
      <Container>
        <Row className="justify-content-md-center div_height ">
          <Col sm={3}>left cont</Col>
          <Col sm={3}>
            <div className="login-div">
              <p className="mb-4">Instagram</p>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
